import React from 'react';
import './App.css';

import photo1 from './roll_1/398049_0021.jpg';

import photo2 from './roll_1/398049_0027.jpg';
import photo3 from './roll_1/398049_0032.jpg';

export default class HomePhotos extends React.Component {
  render () {

    return (
        <div id="pixcontainer">

            <div id="pixblock-1">
                <img alt="broken-house" src={photo1} width={600}></img>
                <img alt="bear" src={photo2} width={600}></img>
            </div>
            <div id="pixblock-2">
                <img alt="jc-window" src={photo3} width={600} height={800}></img>
            </div>

        </div>
    )
  }
}
